import React, { Component } from 'react'

export class nav extends Component {
    render() {
        return (

            <nav class="navbar navbar-expand-sm bg-light navbar-light">
                <ul class="navbar-nav">
                    <li class="nav-item active">
                        <a class="nav-link" href="#">contacts</a>
                    </li>
                </ul>
            </nav>
        )
    }
}

export default nav
